import { Paper } from "@mui/material";
import { Container, margin, padding, width } from "@mui/system";
import { useState } from "react";

export default function Myform(){
    const paperstyle ={padding:"50px 20px", width:600, margin:"20px auto"}
    const[eventName, setEventName]=useState('')
    const[totalTickets, setTotalTickets]=useState('')
    const[ticketReleaseRate, setTicketReleaseRate]=useState('')
    const[customerReleaseRate, setCustomerReleaseRate]=useState('')
    const[maxTicketCapacity, setMaxTicketCapacity]=useState('')

    return(
        <Container>
            <Paper elevation={3} style={paperstyle}>
                <h2><u>Administrator Privilage Only</u></h2>
                <br></br>
                <h3><u>Configure form</u></h3>
                <form style={{paddingTop:'50px',display:"flex", flexDirection:"column",rowGap:'20px'}}>
                    <label>Enter Event Name: 
                        <input type="text" value={''}></input>
                    </label>
                    <label>Enter Total Number of Ticket:
                        <input type="text"></input>
                    </label>
                    <label>Enter Ticket Release Rate:
                        <input type="text"></input>
                    </label>
                    <label>Enter Customer Release Rate:
                        <input type="text"></input>
                    </label>
                    <label>Enter Maximum Capacity of Ticket Pool:
                        <input type="text"></input>
                    </label>
                </form>
            </Paper>
        </Container>    
    )
}
